import React, { useEffect, useState } from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Box,
  CircularProgress,
  Card,
  CardContent,
  CardMedia,
  Grid,
  LinearProgress,
} from "@mui/material";
import axios from "axios";
import { mapImages, MapName } from "../constants/mapImages";

interface MapStats {
  mapName: string;
  matches: number;
  wins: number;
  winRate: number;
}

interface Player {
  id: string;
  name: string;
  stats: {
    totalKills: number;
    totalAssists: number;
    totalDeaths: number;
    totalMatches: number;
    winRate: number;
    averageKd: number;
    averageImpact: number;
    mapStats: MapStats[];
  };
}

const PlayerStats: React.FC = () => {
  const [players, setPlayers] = useState<Player[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPlayers = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/players");
        setPlayers(response.data);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching players:", error);
        setLoading(false);
      }
    };

    fetchPlayers();
  }, []);

  if (loading) {
    return (
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        minHeight="100vh"
      >
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box>
      {players.map((player) => (
        <Paper key={player.id} sx={{ p: 3, mb: 3 }}>
          <Typography variant="h5" gutterBottom>
            {player.name}
          </Typography>

          <Grid container spacing={2} sx={{ mb: 3 }}>
            <Grid item xs={12} sm={6} md={3}>
              <Typography variant="subtitle1">
                Всего матчей: {player.stats.totalMatches}
              </Typography>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Typography variant="subtitle1">
                Общий винрейт: {player.stats.winRate.toFixed(2)}%
              </Typography>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Typography variant="subtitle1">
                K/D: {player.stats.averageKd.toFixed(2)}
              </Typography>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Typography variant="subtitle1">
                Импакт: {player.stats.averageImpact.toFixed(2)}
              </Typography>
            </Grid>
          </Grid>

          <Typography variant="h6" gutterBottom sx={{ mt: 4 }}>
            Статистика по картам
          </Typography>

          <Grid container spacing={3}>
            {player.stats.mapStats.map((mapStat) => (
              <Grid item xs={12} sm={6} md={4} key={mapStat.mapName}>
                <Card>
                  <CardMedia
                    component="img"
                    height="200"
                    image={
                      mapImages[mapStat.mapName as MapName] ||
                      "/images/default-map.jpg"
                    }
                    alt={mapStat.mapName}
                    sx={{
                      objectFit: "cover",
                      filter: "brightness(0.9)",
                    }}
                  />
                  <CardContent>
                    <Typography variant="h6" gutterBottom>
                      {mapStat.mapName}
                    </Typography>
                    <Box
                      sx={{
                        display: "flex",
                        justifyContent: "space-between",
                        mb: 1,
                      }}
                    >
                      <Typography variant="body2" color="text.secondary">
                        Матчей: {mapStat.matches}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        Побед: {mapStat.wins}
                      </Typography>
                    </Box>
                    <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
                      <LinearProgress
                        variant="determinate"
                        value={mapStat.winRate}
                        sx={{
                          flexGrow: 1,
                          height: 10,
                          borderRadius: 5,
                          backgroundColor: "rgba(255,255,255,0.1)",
                          "& .MuiLinearProgress-bar": {
                            backgroundColor:
                              mapStat.winRate >= 50 ? "#4caf50" : "#f44336",
                            borderRadius: 5,
                          },
                        }}
                      />
                      <Typography
                        variant="body2"
                        sx={{
                          minWidth: 45,
                          color: mapStat.winRate >= 50 ? "#4caf50" : "#f44336",
                          fontWeight: "bold",
                        }}
                      >
                        {mapStat.winRate.toFixed(1)}%
                      </Typography>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Paper>
      ))}
    </Box>
  );
};

export default PlayerStats;
